// src/components/Teams.jsx
export default function Teams() {
  const teamMembers = [
    { name: "Alice Johnson", role: "Project Manager" },
    { name: "Bob Smith", role: "Frontend Developer" },
    { name: "Charlie Brown", role: "Backend Developer" },
    { name: "Diana Prince", role: "UI/UX Designer" },
  ];

  return (
    <div className="bg-white rounded-2xl shadow-lg p-8">
      <h2 className="text-2xl font-bold mb-4">Teams</h2>
      <p className="text-gray-600 mb-6">
        Manage your project teams, add members, and track contributions.
      </p>

      <ul className="space-y-3">
        {teamMembers.map((member, index) => (
          <li
            key={index}
            className="flex items-center justify-between p-4 bg-gray-50 rounded-lg shadow-sm hover:bg-gray-100"
          >
            <div>
              <p className="font-semibold text-gray-800">{member.name}</p>
              <p className="text-gray-500 text-sm">{member.role}</p>
            </div>
            <button className="text-sm bg-blue-500 text-white px-3 py-1 rounded-lg hover:bg-blue-600">
              View
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}
